import React from 'react'

function AdminDashboard() {
  return (
    <div className="container">
        <div className="row">
            <div className="col-md-12 text-center">
                <h3 className="display-3 text-danger">Admin Dashboard</h3>
            </div>
        </div>
    </div>
  )
}

export default AdminDashboard
